PointWebROI(Node, S)

Red = [];               % Контура с током против часовой
Blue = [];              % Контура с током по часовой
    
% ------------------------------------------------------------------------- % Определние изолиний

Nc = Nc*2;
Max = max(max(I));  % Максимальное значение функции потока
Min = min(min(I));  % Минимальное значение функции потока
df = (Max-Min)/(Nc+1);  % Шаг витков
Sr = (abs(Max)+abs(Min))/2;

Lines = zeros(Nc,1);
for i = 1:Nc
    Lines(i) = Min+df*i;
end

% ------------------------------------------------------------------------- 

tic
n_p = 50;

for n = 1:length(S(:,1))
    
    points = [Node(S(n,1),1) Node(S(n,1),2) Node(S(n,1),3) I(S(n,1));...
        Node(S(n,2),1) Node(S(n,2),2) Node(S(n,2),3) I(S(n,2));...
        Node(S(n,3),1) Node(S(n,3),2) Node(S(n,3),3) I(S(n,3))]; % Выеделение элемента (его узлов и значений пф)

    % figure('Name','Элемент','NumberTitle','off');
    % plot3(points(:,1),points(:,2),points(:,3),'b.'); % Отрисовка узлов
    % hold on
    % xlabel ('x [m]'), ylabel ('y [m]'), zlabel ('z [m]')
    % axis equal
    % grid on  
    % plot3(0,0,0,'*r');

    ksi = [points(1,1)-points(3,1) points(1,2)-points(3,2) points(1,3)-points(3,3)];
    eta = [points(2,1)-points(3,1) points(2,2)-points(3,2) points(2,3)-points(3,3)];

    ksi_m = norm(ksi); % 1
    eta_m = norm(eta); % 2

    basis_ksi = ksi/ksi_m;
    basis_eta = eta/eta_m;

    X = [ksi_m 0 0];
    Y = [0 eta_m 0];
    II = [points(1,4) points(2,4) points(3,4)];

    % X_int = linspace(0,ksi_m,100);
    % Y_int = linspace(0,eta_m,100);

    [X_int,Y_int] = meshgrid(linspace(0,ksi_m,n_p), linspace(0,eta_m,n_p));
    II_int = II(3) + ((II(2)-II(3))/Y(2))*Y_int + ((II(1)-II(3))/X(1))*X_int;
    
    for k = 1:Nc
        Temp = [];
        if Lines(k) >= zeror
            AA = find((II_int >= (Lines(k)-er*Sr) & II_int <= (Lines(k)+er*Sr) & II_int >= 0) | (II_int >= (Lines(k)+er*Sr) & II_int <= (Lines(k)-er*Sr) & II_int < 0));
        else
            AA = find((II_int >= (Lines(k)+eb*Sr) & II_int <= (Lines(k)-eb*Sr) & II_int >= 0) | (II_int >= (Lines(k)-eb*Sr) & II_int <= (Lines(k)+eb*Sr) & II_int < 0));
        end

        i = ceil(AA/(n_p));   % Номера столбцов

        j = mod(AA, n_p);     % Номера строк
        j(j==0) = n_p;

        %Temp = zeros(length(i),2);

        for a = 1:length(i)
            if (Y_int(j(a),i(a)) <= (-(Y(2)/X(1))*X_int(j(a),i(a)) + Y(2)))
                A = [X_int(j(a),i(a)) Y_int(j(a),i(a))];
                Temp = [Temp; A];
            end
        end
        if ~isempty(Temp)
            if Lines(k) >= zeror %(Max+Min)/2

                TempRed = zeros(length(Temp(:,1)),3);
                for i = 1:length(Temp(:,1))
                    TempRed(i,:) = Temp(i,1)*basis_ksi + Temp(i,2)*basis_eta + points(3,1:3);
                end

                Red = [Red; TempRed];

            else

                TempBlue = zeros(length(Temp(:,1)),3);
                for i = 1:length(Temp(:,1))
                    TempBlue(i,:) = Temp(i,1)*basis_ksi + Temp(i,2)*basis_eta + points(3,1:3);
                end

                Blue = [Blue; TempBlue];
            end
        end
    end
end

toc

figure('Name','Контур','NumberTitle','off');
plot3(Red(:,1),Red(:,2),Red(:,3),'-r'); % Отрисовка узлов
hold on
plot3(Blue(:,1),Blue(:,2),Blue(:,3),'-b'); % Отрисовка узлов
xlabel ('x'), ylabel ('y'), zlabel ('z')
axis equal
grid on  

