function PointWebROIRB(Node, S, Red, Blue) % Отрисовка точек, элементов и ROI

    figure('Name','All','NumberTitle','off'); 
    movegui([0 560]);
    plot3(Node(:,1),Node(:,2),Node(:,3),'b.'); % Отрисовка узлов
    hold on
    xlabel ('x [m]'), ylabel ('y [m]'), zlabel ('z [m]')
    axis equal
    grid on  
    for i = 1:length(S(:,1))
        plot3(Node(S(i,:),1),Node(S(i,:),2),Node(S(i,:),3),'r-'); % Отрисовка сетки
    end
    plot3(Red(:,1),Red(:,2),Red(:,3),'r.'); % Отрисовка узлов
    plot3(Blue(:,1),Blue(:,2),Blue(:,3),'b.'); % Отрисовка узлов
        
end






